import React from 'react'
import styled from 'styled-components'
import { BrowserFingerprint } from "browser_fingerprint";

import Title from '../src/components/atoms/title'

const Main = styled.main`
  background: #282A36;
  height: 100%;
  width: 100%;
`

export default () => {

  const bla = new BrowserFingerprint({
    cookieKey: "fingerPrint",
    toSetCookie: true,
  })
  return (
    <Main>
      <Title fingerPrint={bla.savedHashedPid as string}/>
    </Main>
  )
}
